(1, 1, '2016-09-02 13:13:26', '2016-09-02 13:13:26', 'When you need your company to have a new website or if you venture on updating your old webpage with a new look and functionality, the choices are versatile…\r\n\r\nAssuming that you will go the easy way and choose a theme for your Wordpress website, the overall number of characteristics that you will need to keep in mind narrows down significantly.\r\n\r\nBut how do you stay focused on what kind of a template you need and what do you want to get from that template?\r\n\r\nWe recommend focusing on 4 most essential characteristics, each vital for your company’s to have an efficient and long-standing online presence!\r\n\r\nThese are: Design or Visual Looks; Functionality; Easy Installation and Administering &amp; Google-friendliness.\r\n<h4>#1: Design or Visual Looks</h4>\r\nAll the Wordpress themes that we have here have had a vast team of professional designers sketching, working and executing the ultimate visual look for it.\r\n\r\n<img class="alignnone size-full wp-image-1009" src="your_website_url_here/wp-content/uploads/2016/10/img19.jpg" alt="" width="1497" height="1080" />\r\n\r\nWith such a wide range of choices at hand, we strongly advise you to stick to the Wordpress Theme that is based on your business’ or a closely related field. Either way, thanks to all the diversity here you will be able to choose a Theme that can be either of a formal color scheme with some light colors in it or a more vivid one, featuring bold textures and hues!\r\n<h4>#2: Functionality</h4>\r\nEach business niche may require a unique functionality of its own\r\n\r\nWith that notion in mind, our team of professional Wordpress coders has been working day and night to roll out a definitive collection of built-in Wordpress plugins, that come with each of our Wordpress themes…\r\n<h4>#3: Easy Installation and Administering</h4>\r\nDue to the fact that this is a Wordpress theme, the process of installing it and using it is truly as easy as it gets!', 'Blemish-free roses', 'Well, for those of you who''ve never been busy with planting (or caring) for flowers, namely the roses - here''s a small listicle of tips, dos and do-nots. First of all, be sure to keep your efforts on both the flower''s pruning and the factor of keeping the center of the flower open to the sun at all times and at all...\r\n', 'publish', 'open', 'open', '', 'blemish-free-roses', '', '', '2016-12-28 16:52:51', '2016-12-28 16:52:51', '', 0, 'your_website_url_here/?p=1', 0, 'post', '', 1),
(2, 1, '2016-09-02 13:13:26', '2016-09-02 13:13:26', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="your_website_url_here/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2016-09-02 13:13:26', '2016-09-02 13:13:26', '', 0, 'your_website_url_here/?page_id=2', 0, 'page', '', 0),
