ening enthusiasts, with all of our love for all things green.</h6>\r\n<h6>Initially founded as a small garden care/design and lawn mowing company 10 years ago, we''ve had just 4 employees for starters.</h6>\r\n<h6>Now we''ve grown to become one of the biggest companies in the local area, praised by all of the local folks!</h6>\r\n<h6>During these 10 years we''ve literally cared for thousands of small private and public, commercial gardens and lawns all across our beautiful county!</h6>\r\n\r\n[/tm_pb_text][/tm_pb_column][/tm_pb_row][/tm_pb_section][tm_pb_section admin_label="Section" fullwidth="off" specialty="off" transparent_background="on" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off" module_class="blurb_counter "][tm_pb_row admin_label="Row" make_fullwidth="on" use_custom_width="off" use_grid_padding="off" width_unit="on" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" parallax_2="off" parallax_method_2="off" parallax_3="off" parallax_method_3="off" parallax_4="off" parallax_method_4="off" column_padding_mobile="on"][tm_pb_column type="1_3"][tm_pb_blurb admin_label="Blurb" title="BEST PRICING" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" image="your_website_url_here/wp-content/uploads/2016/09/img4.png" icon_placement="top" animation="off" text_orientation="center" use_icon_font_size="off" background_image="your_website_url_here/wp-content/uploads/2016/09/img7.jpg" use_border_color="off" border_color="#ffffff" border_style="solid" custom_padding="82px||75px|" custom_padding_tablet="80px||75px|" custom_padding_phone="50px||50px|" custom_padding_last_edited="on|phone" header_text_color="#ffffff" saved_tabs="all" url