round_image="your_website_url_here/wp-content/uploads/2016/09/bg05.jpg" transparent_background="on" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off"][tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" custom_padding="79px||120px|" custom_padding_tablet="70px||100px|" custom_padding_phone="60px||60px|" custom_padding_last_edited="on|phone" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" column_padding_mobile="on"][tm_pb_column type="4_4"][tm_pb_text admin_label="Text" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h5>What We Do</h5>\r\n<h5>With years of practical (both personal and work-related) experience at hand and a huge team of passionate professionals, we can do anything!</h5>\r\n<h5>Virtually any routine garden task, such as lawn mowing, hedges pruning and trimming, flower or plants seeding and maintenance - comes naturally for us!</h5>\r\n<h5>So if for you taking care of the garden is either a too time-consuming errand or just a mere outdoors decor matter, be sure that we''ll provide you a diligent and expert help, anytime!</h5>\r\n\r\n[/tm_pb_text][/tm_pb_column][/tm_pb_row][/tm_pb_section][tm_pb_section admin_label="Section" fullwidth="off" specialty="off" transparent_background="off" background_color="#ffffff" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off"][tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" parallax_2="off" parallax_method_2="off" parallax_3="off" parallax_method_3="off" column_padding_mobile="on"][tm_pb_column type="1_3"][tm_pb_team_member admin_label="Person" saved_tabs="general" name="Alex Buoyega" position="Gardner" image_url="your_website_url_here/wp-content/uploads/2016/09/img39.jpg" animation="off" text_alignment="left" background_layout="light" use_border_color="off" border_color="#ffffff" border_style="solid" background_color="#ffffff"]\r\n\r\n<p>\r\nMr. Buoyega was born in one of Detroit’s poorest blocks, all before pursuing his successful managerial career in the future. For him, the breakthrough happened when he was able to get on Harvard University’s Law School list. After graduating from there, he was working for a few years for a number of multi-million dollar corporations, climbing up the corporate ladder and...</p>\r\n\r\n[/tm_pb_team_member][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_team_member admin_label="Person" saved_tabs="general" name="Kenneth Richardson" position="Gardner" image_url="your_website_url_here/wp-content/uploads/2016/09/img41.jpg" animation="off" text_alignment="left" background_layout="light" use_border_color="off" border_color="#ffffff" border_style="solid" background_color="#ffffff"]\r\n\r\n<p>\r\nA talented and creative leader, Kenneth is known among his colleagues for how good his organizing and team leading skills are… Working priorly for a number of American and International multi-billion dollar companies, Kenneth has built up a reputation and a skillset worthy of an executive manager. His constant focus at work is on...</p>\r\n\r\n[/tm_pb_team_member][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_team_member admin_label="Person" saved_tabs="general" name="Mary Applebaum" position="Gardner" image_url="your_website_url_here/wp-content/uploads/2016/09/img40.jpg" animation="off" text_alignment="left" background_layout="light" use_border_color="off" border_color="#ffffff" border_style="solid" background_color="#ffffff"]\r\n\r\n<p>\r\nA Juneau, Alaska native, Mrs. Applebaum has come a long way since her high school graduation all the way up to getting a Brown University Master’s degree in Economics. Talented with the digits, she’s no less successful when it comes to managing the human resources of the company. Ask anyone at our office who is their personal favorite manager...</p>\r\n\r\n[/tm_pb_team_member][/tm_pb_column][/tm_pb_row][/tm_pb_section][tm_pb_section admin_label="Section" fullwidth="off" specialty="off" background_image="your_website_url_here/wp-content/uploads/2016/09/img42.jpg" transparent_background="on" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off"][tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" custom_padding="122px||148px|" custom_padding_tablet="100px||130px|" custom_padding_phone="60px||60px|" custom_padding_last_edited="on|desktop" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" parallax_2="off" parallax_method_2="off" column_padding_mobile="on" custom_padding_laptop="122px||140px|"][tm_pb_column type="1_2"][tm_pb_text admin_label="Text" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid" custom_margin="||40px|" custom_margin_laptop="||30px|" custom_margin_tablet="||20px|" custom_margin_phone="||10px|" custom_margin_last_edited="on|phone"]\r\n\r\n<h3>Job Openings</h3>\r\n<p><span style="color: #3a3a3a;">As our company has been growing exponentially over the last few years, we''re always reasy to welcome new, enthusiastic employees to our team!</span></p>\r\n\r\n[/tm_pb_text][tm_pb_button admin_label="Button" button_url="your_website_url_here/contacts