g"]\r\n\r\n<p>\r\nRegardless of how crazy your exterior idea is, our team of design-and-build experts will easily turn it into reality! This is true both for projects of any scale!</p>\r\n\r\n[/tm_pb_blurb][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_blurb admin_label="Blurb" title="Friendly Prices" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="left" animation="top" text_orientation="left" use_button="off" button_type="link" use_icon_font_size="off" use_border_color="off" border_color="#ffffff" border_style="solid" image="your_website_url_here/wp-content/uploads/2016/09/img16.png"]\r\n\r\n<p>\r\nHaving so much to offer, we also would love to give you the best pricing on all of our services! This means that as compared to our market rivals, our pricing is indeed fair and friendly!</p>\r\n\r\n[/tm_pb_blurb][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_blurb admin_label="Blurb" title="SOFTSCAPES" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="left" animation="top" text_orientation="left" use_button="off" button_type="link" use_icon_font_size="off" use_border_color="off" border_color="#ffffff" border_style="solid" image="your_website_url_here/wp-content/uploads/2016/09/img18.png"]\r\n\r\n<p>\r\nSoftscaping is the total opposite for the hardscaping in that it is neither as long-lasting as the hard structure, nor it is made of materials that are durable.</p>\r\n\r\n[/tm_pb_blurb][/tm_pb_column][/tm_pb_row][/tm_pb_section][tm_pb_section admin_label="Section" fullwidth="off" specialty="off" transparent_background="off" background_color="#ffffff" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gu