ual="off" use_custom_gutter="off" custom_padding="75px||87px|"][tm_pb_row admin_label="Row"][tm_pb_column type="4_4"][tm_pb_text admin_label="Text" text_orientation="center" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h3><span style="color: #ffffff;">Read What Other Happy Customers Have to Say!</span></h3>\r\n\r\n[/tm_pb_text][/tm_pb_column][/tm_pb_row][tm_pb_row admin_label="Row"][tm_pb_column type="1_3"][tm_pb_testimonial admin_label="Testimonial" author="Alison Hankers" url_new_window="off" quote_icon="on" font_icon="f10e" use_background_color="off" background_color="#f5f5f5" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p>\r\n<span style="color: #ffffff;">As I''ve just never had enough time to both do all of my work, home chores and the garden care tasks, I''ve hired these guys to help me!</span></p>\r\n\r\n[/tm_pb_testimonial][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_testimonial admin_label="Testimonial" author="Jane Bond" url_new_window="off" quote_icon="on" font_icon="f10e" use_background_color="off" background_color="#f5f5f5" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p>\r\n<span style="color: #ffffff;">Seeing how much more tidier and greener my sweet little garden has become since these guys took over, I feel incredibly thankful!</span></p>\r\n\r\n[/tm_pb_testimonial][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_testimonial admin_label="Testimonial" author="Mary Appleheather" url_new_window="off" quote_icon="on" font_icon="f10e" use_background_color="off" background_color="#f5f5f5" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p>\r\n<span style="color: #ffffff;">When after years of taking care of my garden all by myself I''ve hired these guys for a little help, I never expected them to be so professional!</span></p>\r\n\r\n[/tm_pb_testimonial][/tm_pb_column][/tm_pb_row][/tm_pb_section]', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2016-12-29 08:46:53', '2016-12-29 08:46:53', '', 0, 'your_website_url_here/?page_id=41', 0, 'page', '', 0),
(48, 1, '2016-09-19 11:19:07', '2016-09-19 11:19:07', 'When you need your company to have a new website or if you venture on updating your old webpage with a new look and functionality, the choices are versatile…\r\n\r\nAssuming that you will go the easy way and choose a theme for your Wordpress website, the overall number of characteristics that you will need to keep in mind narrows down significantly.\r\n\r\nBut how do you stay focused on what kind of a template you need and what do you want to get from that template?\r\n\r\nWe recommend focusing on 4 most essential characteristics, each vital for your company’s to have an efficient and long-standing online presence!\r\n\r\nThese are: Design or Visual Looks; Functionality; Easy Installation and Administering &amp; Google-friendliness.\r\n<h4>#1: Design or Visual Looks</h4>\r\nAll the Wordpress themes that we have here have had a vast team of professional designers sketching, working and executing the ultimate visual look for it.\r\n\r\n<img class="alignnone size-full wp-image-1009" src="your_website_url_here/wp-content/uploads/2016/10/img19.jpg" alt="" width="1497" height="1080" />\r\n\r\nWith such a wide range of choices at hand, we strongly advise you to stick to the Wordpress Theme that is based on your business’ or a closely related field. Either way, thanks to all the diversity here you will be able to choose a Theme that can be either of a formal color scheme with some light colors in it or a more vivid one, featuring bold textures and hues!\r\n<h4>#2: Functionality</h4>\r\nEach business niche may require a unique functionality of its own\r\n\r\nWith that notion in mind, our team of professional Wordpress coders has been working day and night to roll out a definitive collection of built-in Wordpress plugins, that come with each of our Wordpress themes…\r\n<h4>#3: Easy Installation and Administering</h4>\r\nDue to the fact that this is a Wordpress theme, the process of installing it and using it is truly as easy as it gets!', 'Protect your bulbs', 'So, if you''re planting fllowers in your garden, there''s an additional thing or two that you might want to know about protecting the bulbs. This can ring especially true bell when we''re talking about either insects, birds or rodents who are known for partying in your garden, eating thise flower bulbs up...\r\n', 'publish', 'open', 'open', '', 'protect-your-bulbs', '', '', '2016-12-28 16:41:16', '2016-12-28 16:41:16', '', 0, 'your_website_url_here/?p=48', 0, 'post', '', 4),
