(116, 1, '2016-09-23 07:30:45', '2016-09-23 07:30:45', '[tm_pb_section admin_label="section" transparent_background="off" background_color="#ffffff" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" custom_padding_last_edited="on|phone" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off" custom_padding="||20px|" custom_padding_tablet="||19px|" custom_padding_phone="||20px|"][tm_pb_row admin_label="Row"][tm_pb_column type="4_4"][tm_pb_text admin_label="Text" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid" custom_padding="|||30px" custom_padding_tablet="|||25px" custom_padding_phone="|||20px" custom_padding_last_edited="on|phone"]\r\n\r\n<h3>Blurb</h3>\r\n\r\n[/tm_pb_text][/tm_pb_column][/tm_pb_row][tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" custom_padding="20px|||" custom_padding_laptop="15px|||" custom_padding_tablet="10px|||" custom_padding_last_edited="on|phone" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" parallax_2="off" parallax_method_2="off" column_padding_mobile="on"][tm_pb_column type="1_2"][tm_pb_blurb admin_label="Blurb" title="Creative ideas" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="top" animation="top" text_orientation="left" use_button="off" button_type="link" use_icon_font_size="off" use_border_color="off" border_color="#ffffff" border_style="solid" image="your_website_url_here/wp-content/uploads/2016/09/img13.png"]\r\n\r\n<p>\r\nServing everyone from household owners to hotels and office, we make sure to provide a truly full-cycle range of exterior design, landscaping, and exterior remodeling services!</p>\r\n\r\n[/tm_pb_blurb][/tm_pb_column][tm_pb_column type="1_2"][tm_pb_blurb admin_label="Blurb" title="DECORATING" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="top" animation="top" text_orientation="left" use_button="off" button_type="link" use_icon_font_size="off" use_border_color="off" border_color="#ffffff" border_style="solid" image="your_website_url_here/wp-content/uploads/2016/09/img15.png"]\r\n\r\n<p>\r\nIt does not really matter is it the Christmas time of the year or not, priming your house with some decorative elements or masonry should not and is not a seasonal fad!</p>\r\n\r\n[/tm_pb_blurb][/tm_pb_column][/tm_pb_row][tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" custom_padding="60px|||" custom_padding_tablet="40px|||" custom_padding_phone="30px|||" custom_padding_last_edited="on|phone" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" parallax_2="off" parallax_method_2="off" column_padding_mobile="on"][tm_pb_column type="1_2"][tm_pb_blurb admin_label="Blurb" title="Creative ideas" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="left" animation="top" text_orientation="left" use_button="off" button_type="link" use_icon_font_size="off" use_border_color="off" border_color="#ffffff" border_style="solid" image="your_website_url_here/wp-content/uploads/2016/09/img13.png"]\r\n\r\n<p>\r\nServing everyone from household owners to hotels and office, we make sure to provide a truly full-cycle range of exterior design, landscaping, and exterior remodeling services!</p>\r\n\r\n[/tm_pb_blurb][/tm_pb_column][tm_pb_column type="1_2"][tm_pb_blurb admin_label="Blurb" title="DECORATING" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="left" animation="top" text_orientation="left" use_button="off" button_type="link" use_icon_font_size="off" use_border_color="off" border_color="#ffffff" border_style="solid" image="your_website_url_here/wp-content/uploads/2016/09/img15.png"]\r\n\r\n<p>\r\nIt does not really matter is it the Christmas time of the year or not, priming your house with some decorative elements or masonry should not and is not a seasonal fad!</p>\r\n\r\n[/tm_pb_blurb][/tm_pb_column][/tm_pb_row][tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" custom_padding="40px|||" custom_padding_tablet="35px|||" custom_padding_last_edited="on|phone" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" parallax_2="off" parallax_method_2="off" column_padding_mobile="on"][tm_pb_column type="1_2"][tm_pb_blurb admin_label="Blurb" title="GARDEN DESIGN" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="left" animation="top" text_orientation="left" use_button="off" button_type="link" use_icon_font_size="off" use_border_color="off" border_color="#ffffff" border_style="solid" image="your_website_url_here/wp-content/uploads/2016/09/img17.png"]\r\n\r\n<p>\r\nDid you ever consider giving your house exterior or your landscape a unique look, implementing some superb design ideas you’ve seen before in the magazines?</p>\r\n\r\n[/tm_pb_blurb][/tm_pb_column][tm_pb_column type="1_2"][tm_pb_blurb admin_label="Blurb" title="SOFTSCAPES" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="left" animation=