en has become since these guys took over, I feel incredibly thankful!</p>\r\n\r\n[/tm_pb_testimonial][/tm_pb_column][/tm_pb_row][tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" custom_padding="25px|15px||" custom_padding_tablet="21px|15px||" custom_padding_phone="20px|14px||" custom_padding_last_edited="on|phone" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" parallax_2="off" parallax_method_2="off" parallax_3="off" parallax_method_3="off" column_padding_mobile="on" custom_padding_laptop="25px|14px||"][tm_pb_column type="1_3"][tm_pb_testimonial admin_label="Testimonial" author="Alejandro Boone" url_new_window="off" quote_icon="on" font_icon="f10e" use_background_color="off" background_color="#f5f5f5" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p>\r\nAs I''ve just never had enough time to both do all of my work, home chores and the garden care tasks, I''ve hired these guys to help me!</p>\r\n\r\n[/tm_pb_testimonial][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_testimonial admin_label="Testimonial" author="Jon Ferguson" url_new_window="off" quote_icon="on" font_icon="f10e" use_background_color="off" background_color="#f5f5f5" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p>\r\nSeeing how much more tidier and greener my sweet little garden has become since these guys took over, I feel incredibly thankful!</p>\r\n\r\n[/tm_pb_testimonial][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_testimonial admin_label="Testimonial" author="Jon Ferguson" url_new_window="off" quote_icon="on" font_icon="f10e" use_background_color="off" background_color="#f5f5f5" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p>\r\nWhen after years of taking care of my garden all by mysel