"section" transparent_background="off" background_color="#ffffff" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" custom_padding_last_edited="off|desktop" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off" custom_css_main_element="margin-top:20px;"][tm_pb_row admin_label="Row"][tm_pb_column type="4_4"][tm_pb_text admin_label="Text" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid" custom_padding_last_edited="on|phone" custom_padding="|||30px" custom_padding_tablet="|||25px"]\r\n\r\n<h3>Toggles</h3>\r\n\r\n[/tm_pb_text][tm_pb_toggle admin_label="Toggle" title="Lawn Mowing & Lawn Care" open="on" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p>There''s a whole lot of small nuances, regarding the look, the maintenance and care for one''s lawn.</p>\r\n<p>Whenever you feel too busy for mowing your own lawn, just call one of our guys - and he''ll do all the green job!</p>\r\n<p>Also caring about your lawn is so much more, than just mowing it occasionally... Let us take care of it all!</p>\r\n\r\n[/tm_pb_toggle][tm_pb_toggle admin_label="Toggle" title="Garden Care" open="off" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p>If your garden is all nurtured and spruced up, besides improving your mood it will also increase the property value, by much!</p>\r\n<p>This means, that as a team of absolute gardening experts, we''ll be ready to assist with garden care activities of any sort.</p>\r\n<p>Starting with hedging, pruning, planting and de-thatching, we know how to help your garden keep up the shape!</p>\r\n\r\n[/tm_pb_toggle][tm_pb_toggle admin_label="Toggle" title="Flowers & Plants" open="off" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p>Taking care of plants and flowers for both commercial and residential areas, we love to keep the world greener and tidier!</p>\r\n<p>As a team of experts, we''re handy in working with absolutely any kind of plants, trees, and flowers.</p>\r\n<p>So whatever you''ll need us to advise you or help you in regard to your garden, we''ll be ready to do that at once!</p>\r\n\r\n[/tm_pb_toggle][/tm_pb_column][/tm_pb_row][/tm_pb_section][tm_pb_section admin_label="section" transparent_background="off" background_color="#ffffff" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" custom_padding_last_edited="on|phone" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off" custom_css_main_element="margin-top:20px;" custom_padding="||20px|" custom_padding_tablet="||19px|"][tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" custom_padding="|30px||30px" custom_padding_tablet="|25px||25px" custom_padding_last_edited="on|desktop" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" column_padding_mobile="on" custom_padding_phone="|20px||20px"][tm_pb_column type="4_4"][tm_pb_text admin_label="Text" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid" custom_padding_last_edited="on|desktop"]\r\n\r\n<h3>Tabs</h3>\r\n\r\n[/tm_pb_text][tm_pb_tabs admin_label="Tabs" saved_tabs="general" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n[tm_pb_tab title="Garden Design" tab_font_select="default" tab_font="||||" tab_line_height="2em" tab_line_height_tablet="2em" tab_line_height_phone="2em" body_font_select="default" body_font="||||" body_line_height="2em" body_line_height_tablet="2em" body_line_height_phone="2em" tab_line_height_laptop="2em" body_line_height_laptop="2em"]\r\n<p>There''s a whole lot of small nuances, regarding the look, the maintenance and care for one''s lawn.</p>\r\n<p>Whenever you feel too busy for mowing your own lawn, just call one of our guys - and he''ll do all the green job!</p>\r\n<p>Also caring about your lawn is so much more, than just mowing it occasionally... Let us take care of it all!</p>\r\n[/tm_pb_tab][tm_pb_tab title="Garden Care" tab_font_select="default" tab_font="||||" tab_line_height="2em" tab_line_height_tablet="2em" tab_line_height_phone="2em" body_font_select="default" body_font="||||" body_line_height="2em" body_line_height_tablet="2em" body_line_height_phone="2em" tab_line_height_laptop="2em" body_line_height_laptop="2em"]\r\n<p>If your garden is all nurtured and spruced up, besides improving your mood it will also increase the property value, by much!</p>\r\n<p>This means, that as a team of absolute gardening experts, we''ll be ready to assist with garden care activities of any sort.</p>\r\n<p>Starting with hedging, pruning, planting and de-thatching, we know how to help your garden keep up the shape!</p>\r\n[/tm_pb_tab][tm_pb_tab title="Flowers &amp; Plants" tab_font_select="default" tab_font="||||" tab_line_height="2em" tab_line_height_tablet="2em" tab_line_height_phone="2em" body_font_select="default" body_font="||||" body_line_height="2em" body_line_height_tablet="2em" body_line_height_phone="2em" tab_line_height_laptop="2em" body_line_height_laptop="2em"]\r\n<p>Taking care of plants and flowers for both commercial and residential areas, we love to keep the world greener and tidier!</p>\r\n<p>As a team of experts, we''re handy in working with absolutely any kind of plants, trees, and flowers.</p>\r\n<p>So whatever you''ll need us to advise you or help you in regard to your garden, we''ll be ready to do that at once!</p>\r\n[/tm_pb_tab]\r\n\r\n[/tm_pb_tabs][/tm_pb_column][/tm_pb_row][/tm_pb_section][tm_pb_section admin_label="section" transparent_background="off" background_color="#ffffff" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" custom_padding_last_edited="on|phone" paddi