e="New Service Ready" number="61" percent_sign="on" counter_color="#66ab36" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n</p>\r\n\r\n[/tm_pb_number_counter][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_number_counter admin_label="Number Counter" title="Clients back" number="42" percent_sign="on" counter_color="#66ab36" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n</p>\r\n\r\n[/tm_pb_number_counter][/tm_pb_column][/tm_pb_row][/tm_pb_section][tm_pb_section admin_label="section" transparent_background="off" background_color="#ffffff" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" custom_padding_last_edited="on|phone" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off" custom_css_main_element="margin-top:20px;||margin-bottom:30px;" custom_padding="||20px|" custom_padding_tablet="||19px|"][tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" custom_padding="|30px||30px" custom_padding_tablet="|25px||25px" custom_padding_last_edited="on|desktop" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" column_padding_mobile="on" custom_padding_phone="|20px||20px"][tm_pb_column type="4_4"][tm_pb_text admin_label="Text" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid" custom_padding_last_edited="on|desktop"]\r\n\r\n<h3>Accordion</h3>\r\n\r\n[/tm_pb_text][/tm_pb_column][/tm_pb_row][tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" column_padding_mobile="on"][tm_pb_column type="4_4"][tm_pb_accordion admin_label="Accordion" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p>\r\n[tm_pb_accordion_item title="Lawn Mowing &amp; Lawn Care"]</p>\r\n<p>There''s a whole lot of small nuances, regarding the look, the maintenance and care for one''s lawn.</p>\r\n<p>Whenever you feel too busy for mowing your own lawn, just call one of our guys - and he''ll do all the green job!</p>\r\n<p>Also caring about your lawn is so much more, than just mowing it occasionally... Let us take care of it all!</p>\r\n<p>[/tm_pb_accordion_item][tm_pb_accordion_item title="Garden Care"]</p>\r\n<p>If your garden is all nurtured and spruced up, besides improving your mood it will also increase the property value, by much!</p>\r\n<p>This means, that as a team of absolute gardening experts, we''ll be ready to assist with garden care activities of any sort.</p>\r\n<p>Starting with hedging, pruning, planting and de-thatching, we know how to help your garden keep up the shape!</p>\r\n<p>[/tm_pb_accordion_item][tm_pb_accordion_item title="Flowers &amp; Plants"]</p>\r\n<p>Taking care of plants and flowers for both commercial and residential areas, we love to keep the world greener and tidier!</p>\r\n<p>As a team of experts, we''re handy in working with absolutely any kind of plants, trees, and flowers.</p>\r\n<p>So whatever you''ll need us to advise you or help you in regard to your garden, we''ll be ready to do that at once!</p>\r\n<p>[/tm_pb_accordion_item][tm_pb_accordion_item title="Garden Design &amp; Landscaping"]</p>\r\n<p>As landscape and exterior design firm we feel most comfortable working in spacious suburban areas...</p>\r\n<p>Additionally, the greenwalls installation makes up a big part of our urban landscaping services list.</p>\r\n<p>On par with that, commercial locations, such as offices or shopping malls use our greening services a lot.</p>\r\n<p>[/tm_pb_accordion_item]</p>\r\n\r\n[/tm_pb_accordion][/tm_pb_column][/tm_pb_row][tm_pb_row admin_label="Row"][tm_pb_column type="4_4"][tm_pb_video admin_label="Video" src="https://www.youtube.com/watch?v=AuBnqBuV6i8"]\r\n\r\n</p>\r\n\r\n[/tm_pb_video][tm_pb_video_slider admin_label="Video Slider" show_image_overlay="hide" show_arrows="on" show_thumbnails="on"]\r\n\r\n<p>\r\n[tm_pb_video_slider_item admin_title="Video" src="https://www.youtube.com/watch?v=5okJW7594zk" image_src="your_website_url_here/wp-content/uploads/2016/09/img48.jpg"]<br />[/tm_pb_video_slider_item][tm_pb_video_slider_item admin_title="Video" src="https://www.youtube.com/watch?v=7wAa2Y8CAIk"]<br />[/tm_pb_video_slider_item][tm_pb_video_slider_item admin_title="Video" src="https://www.youtube.com/watch?v=LmIw9-TeOV4"]<br />[/tm_pb_video_slider_item][tm_pb_video_slider_item admin_title="Video" src="https://www.youtube.com/watch?v=Vf1UUzgGPto"]<br />[/tm_pb_video_slider_item][tm_pb_video_slider_item admin_title="Video" src="https://www.youtube.com/watch?v=6a1zbt_R-dg"]<br />[/tm_pb_video_slider_item]</p>\r\n\r\n[/tm_pb_video_slider][/tm_pb_column][/tm_pb_row][/tm_pb_section]', 'Elements', '', 'publish', 'closed', 'closed', '', 'elements', '', '', '2016-12-29 16:28:48', '2016-12-29 16:28:48', '', 0, 'your_website_url_here/?page_id=116', 0, 'page', '', 0);
