(261, 1, '2016-10-17 13:32:43', '2016-10-17 13:32:43', '[tm_pb_blurb admin_label="Blurb" saved_tabs="general" title="Solar Highways" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" image="your_website_url_here/wp-content/uploads/2016/09/blurb01.png" icon_placement="top" animation="off" text_orientation="center" template_type="module"]\n\n<p>By accepting the progressive renewable energy industry, the government planned few new highways across the Britain to be equipped with built-in solar panels.</p>\n\n[/tm_pb_blurb]', 'blurb_top', '', 'publish', 'closed', 'closed', '', 'blurb_top', '', '', '2016-10-17 13:32:43', '2016-10-17 13:32:43', '', 0, 'your_website_url_here/tm_pb_layout/blurb_top/', 0, 'tm_pb_layout', '', 0),
