(288, 1, '2016-10-18 14:07:04', '2016-10-18 14:07:04', '[tm_pb_toggle admin_label="Toggle" saved_tabs="general" title="Solar panels moving" open="off" template_type="module"]\n\n<p>Besides providing miscellaneous solar power solutions for private clients and residential buildings, we also help commercial businesses, as well as government institutions in switching to solar.</p><p>If you''re an owner or a manager of a small, medium or a big business or a separate office building, then we''ll be glad to advise you on this matter.</p><p>It''s important to remember, that switching high-consumption offices to solar takes more time in both preparation and technical equipment manufacturing and installing.</p>\n\n[/tm_pb_toggle]', 'toggle', '', 'publish', 'closed', 'closed', '', 'toggle', '', '', '2016-10-18 14:07:04', '2016-10-18 14:07:04', '', 0, 'your_website_url_here/tm_pb_layout/toggle/', 0, 'tm_pb_layout', '', 0),
