(543, 1, '2016-10-27 13:31:21', '2016-10-27 13:31:21', '[tm_pb_section admin_label="section"][tm_pb_row admin_label="row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" column_padding_mobile="on" custom_css_main_element="max-width:940px;||margin: 0 auto;" custom_padding="||50px|" custom_padding_tablet="||40px|" custom_padding_phone="||30px|" custom_padding_last_edited="on|phone"][tm_pb_column type="4_4"][tm_pb_text admin_label="Text" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid" custom_padding="||20px|" custom_padding_tablet="||19px|" custom_padding_phone="||20px|" custom_padding_last_edited="on|phone"]\r\n<h3 style="text-align: center;">Frequently Asked Questions</h3>\r\n<p style="text-align: center;">While selling the best men care products to thousands of customers each year, we''ve accumulated a shortlist of the most popular FAQ queries, most typically asked by our customers.</p>\r\n[/tm_pb_text][tm_pb_accordion admin_label="Accordion" use_border_color="off" border_color="#ffffff" border_style="solid" custom_padding_last_edited="on|phone"] [tm_pb_accordion_item title="Q: What are the advantages of purchasing a website template?"]\r\n\r\n&nbsp;\r\n\r\n<span style="color: #80c52e;">A:</span> The major advantage is price: You get a high quality design for just $20-$70. You don’t have to hire a web designer or web design studio. Second advantage is time frame: It usually takes 5-15 days for a good designer to produce a web page of such quality.\r\n\r\n[/tm_pb_accordion_item][tm_pb_accordion_item title="Q: Do you provide any scripts with your templates or could you do some custom programming?"]\r\n\r\n<span style="color: #80c52e;">A:</span> Our templates do not include any additional scripts. Newsletter subscriptions, search fields, forums, image galleries (in HTML versions of Flash products) are inactive. Basic scripts can be easily added at www.TemplateTuning.com If you are not sure that the element you’re interested in is active please contact our Support Chat for clarification.\r\n\r\n[/tm_pb_accordion_item][tm_pb_accordion_item title="Q: What do I receive when I order a template from TemplateMonster.com?"]\r\n\r\n<span style="color: #80c52e;">A:</span> After you complete the payment via our secure form you will receive the instructions for downloading the product. The source files in the download package can vary based on the type of the product you have purchased.\r\n\r\n[/tm_pb_accordion_item][tm_pb_accordion_item title="Q: What is TemplateMonster clipart library?"]\r\n\r\n<span style="color: #80c52e;">A:</span>It is a selection of elements that may be helpful during creation of websites using our templates.\r\n\r\nElements included (quantity is approximate):\r\n\r\nArrows\r\n\r\n: 25 items\r\n\r\nBullets\r\n\r\n: 10 items\r\n\r\nButtons\r\n\r\n: 15 items\r\n\r\nIcons\r\n\r\n: 15 items\r\n\r\nLogos\r\n\r\n: 25 items\r\n\r\nWindows for content (ie. News box. etc.)\r\n\r\n: 3 items\r\n\r\nOther elements\r\n\r\n: 100 items\r\n\r\nAll these elements are provided in Photoshop\r\n\r\n[/tm_pb_accordion_item]\r\n\r\n[/tm_pb_accordion][/tm_pb_column][/tm_pb_row][/tm_pb_section]', 'FAQ', '', 'publish', 'closed', 'closed', '', 'faq', '', '', '2016-12-29 08:22:16', '2016-12-29 08:22:16', '', 0, 'your_website_url_here/?page_id=543', 0, 'page', '', 0),
