(567, 1, '2016-11-02 13:54:45', '2016-11-02 13:54:45', 'As landscape and exterior design firm we feel most comfortable working in spacious suburban areas...\r\n\r\nAdditionally, the greenwalls installation makes up a big part of our urban landscaping services list.\r\n\r\nOn par with that, commercial locations, such as offices or shopping malls use our greening services a lot.', 'Garden Design & Landscaping', '', 'publish', 'closed', 'closed', '', 'solar-panels-moving', '', '', '2016-12-28 17:45:28', '2016-12-28 17:45:28', '', 0, 'your_website_url_here/?post_type=cherry-services&#038;p=567', 0, 'cherry-services', '', 0),
(570, 1, '2016-11-03 13:51:27', '2016-11-03 13:51:27', 'Taking care of plants and flowers for both commercial and residential areas, we love to keep the world greener and tidier!\r\n\r\nAs a team of experts, we''re handy in working with absolutely any kind of plants, trees, and flowers.\r\n\r\nSo whatever you''ll need us to advise you or help you in regard to your garden, we''ll be ready to do that at once!', 'Flowers & Plants', '', 'publish', 'closed', 'closed', '', 'solar-panels-moving-2', '', '', '2016-12-28 17:45:24', '2016-12-28 17:45:24', '', 0, 'your_website_url_here/?post_type=cherry-services&#038;p=570', 0, 'cherry-services', '', 0),
(572, 1, '2016-11-03 13:53:49', '2016-11-03 13:53:49', 'If your garden is all nurtured and spruced up, besides improving your mood it will also increase the property value, by much!\r\n\r\nThis means, that as a team of absolute gardening experts, we''ll be ready to assist with garden care activities of any sort.\r\n\r\nStarting with hedging, pruning, planting and de-thatching, we know how to help your garden keep up the shape!', 'Garden Care', '', 'publish', 'closed', 'closed', '', 'solar-panels-moving-3', '', '', '2016-12-28 17:45:22', '2016-12-28 17:45:22', '', 0, 'your_website_url_here/?post_type=cherry-services&#038;p=572', 0, 'cherry-services', '', 0),
(574, 1, '2016-11-03 14:09:28', '2016-11-03 14:09:28', 'There''s a whole lot of small nuances, regarding the look, the maintenance and care for one''s lawn.\r\n\r\nWhenever you feel too busy for mowing your own lawn, just call one of our guys - and he''ll do all the green job!\r\n\r\nAlso caring about your lawn is so much more, than just mowing it occasionally... Let us take care of it all!', 'Lawn Mowing & Lawn Care', '', 'publish', 'closed', 'closed', '', 'solar-panels-moving-4', '', '', '2016-12-28 17:45:19', '2016-12-28 17:45:19', '', 0, 'your_website_url_here/?post_type=cherry-services&#038;p=574', 0, 'cherry-services', '', 0),
