(616, 1, '2016-11-14 17:05:08', '2016-11-14 17:05:08', '[tm_pb_section admin_label="section"][tm_pb_row admin_label="row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" custom_padding="|250px|50px|250px" custom_padding_tablet="|150px|40px|150px" custom_padding_phone="|0px|30px|0px" custom_padding_last_edited="on|phone" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" column_padding_mobile="on"][tm_pb_column type="4_4"][tm_pb_text admin_label="Text" text_orientation="center" use_border_color="off" border_color="#ffffff" border_style="solid" custom_margin="||60px|"]\r\n<h3> Privacy Policy</h3>\r\n<h6>This page informs you of our policies regarding the collection, use and disclosure of Personal Information we receive from users of the Site.</h6>\r\nWe use your Personal Information only for providing and improving the Site. By using our Site you agree to the collection and use of information in accordance with this policy.\r\n\r\n[/tm_pb_text][tm_pb_text admin_label="Text" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n<h5>Information Collection And Use</h5>\r\nWhile using our Site we may ask you to provide us with certain personally identifiable information which can be used to contact or identify you. Personally identifiable information may include, but is not limited to: your name; Personal Information; Log Data. Like many site operators, we collect information that your browser sends whenever you visit our Site.\r\n<h5>Log Data</h5>\r\nThis Log Data may include information such as your computers Internet Protocol &amp; IP address; browser type; browser version; the pages of our Site that you visit; the time and date of your visit; the time spent on those pages and other statistics. In addition we may use third party services such as Google Analytics that collect, monitor and analyze this… The Log Data section is for businesses that use analytics or tracking services in websites or apps, like Google Analytics.\r\n<h5>Communications</h5>\r\nWe may use your Personal Information to contact you with newsletters;  marketing or promotional materials and other information.\r\n<h5>Cookies</h5>\r\nCookies are files with small amount of data, which may include an anonymous unique identifier. Cookies are sent to your browser from a website and stored on your computers hard drive. Like many websites, we use “cookies” to collect information. You can instruct your browser to refuse allcookies or to indicate when a cookie is being sent. However, if you do not accept cookies, you may not be able to use some portions of our Site.\r\n<h5>Security</h5>\r\nThe security of your Personal Information is important to us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While we strive to use commercially acceptable means to protect your Personal Information, we cannot guarantee its absolute security due to the nature of the process.\r\n<h5>Changes To This Privacy Policy</h5>\r\nThis Privacy Policy is effective as of March 31st, 2016 and will remain in effect except with respect to any changes in its provisions in the future, which will be in effect immediately after being posted on this page.\r\n\r\nWe reserve the right to update or change our Privacy Policy at any time and you should check this Privacy Policy periodically. Your continued use of the Service after we post any modifications to the Privacy Policy on this page will constitute your acknowledgment of the modifications and your consent to abide and be bound by the modified Privacy Policy.\r\n\r\nIf we make any material changes to this Privacy Policy, we will notify you either through the email address you have provided us, or by placing a prominent notice on our Site.\r\n<h5>Contact Us</h5>\r\nIf you have any questions about this Privacy Policy, please contact us.\r\n\r\n[/tm_pb_text][/tm_pb_column][/tm_pb_row][/tm_pb_section]', 'Privacy Policy', '', 'publish', 'closed', 'closed', '', 'privacy-policy', '', '', '2016-12-23 16:11:33', '2016-12-23 16:11:33', '', 0, 'your_website_url_here/?page_id=616', 0, 'page', '', 0),
