(1104, 1, '2016-12-29 08:46:18', '2016-12-29 08:46:18', '[tm_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" use_grid_padding="on" width_unit="on" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" parallax_2="off" parallax_method_2="off" parallax_3="off" parallax_method_3="off" column_padding_mobile="on" template_type="row"][tm_pb_column type="1_3"][tm_pb_blurb admin_label="Blurb" title="Creative ideas" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="left" animation="top" text_orientation="left" use_button="off" button_type="link" use_icon_font_size="off" use_border_color="off" border_color="#ffffff" border_style="solid" image="your_website_url_here/wp-content/uploads/2016/09/img13.png"]\n\n<p>\nServing everyone from household owners to hotels and office, we make sure to provide a truly full-cycle range of exterior design, landscaping, and exterior remodeling services!</p>\n\n[/tm_pb_blurb][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_blurb admin_label="Blurb" title="DECORATING" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="left" animation="top" text_orientation="left" use_button="off" button_type="link" use_icon_font_size="off" use_border_color="off" border_color="#ffffff" border_style="solid" image="your_website_url_here/wp-content/uploads/2016/09/img15.png"]\n\n<p>\nIt does not really matter is it the Christmas time of the year or not, priming your house with some decorative elements or masonry should not and is not a seasonal fad!</p>\n\n[/tm_pb_blurb][/tm_pb_column][tm_pb_column type="1_3"][tm_pb_blurb admin_label="Blurb" title="GARDEN DESIGN" url_new_window="off" use_icon="off" icon_color="#80c52e" use_circle="off" circle_color="#3a3a3a" use_circle_border="off" circle_border_color="#80c52e" icon_placement="left" animation="top" text_orientation="left" use_button="off" button_type="link" use_icon_font_size="off" use_border_color="off" border_color="#ffffff" border_style="solid" image="your_website_url_here/wp-content/uploads/2016/09/img17.png"]\n\n<p>\nDid you ever consider giving your house exterior or your landscape a unique look, implementing some superb design ideas you’ve seen before in the magazines?</p>\n\n[/tm_pb_blurb][/tm_pb_column][/tm_pb_row]', 'blurbs', '', 'publish', 'closed', 'closed', '', 'blurbs-2', '', '', '2016-12-29 08:46:18', '2016-12-29 08:46:18', '', 0, 'your_website_url_here/tm_pb_layout/blurbs-2/', 0, 'tm_pb_layout', '', 0);
